import { CloudDemo } from "./cloud/cloud";
import { BlogDemo } from "./blog/blog";

function App() {
  return (
    <div className="container-fluid">
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<HomeDemo />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
